import React, { createContext, useState } from "react";

export const contextData = createContext(); //api // context value creating

export const Context = (props) => {
  //data
  const [data, setData] = useState([]);
  useEffect(() => {
    async function fetchData() {
      await axios
        .get("https://hidden-water-5678.herokuapp.com/api/v1/data3/homed")
        .then((req, res) => {
          const response = req.data;
          setData(response);
          console.log("hii, data recieved here, label 3 img");
        })
        .catch(() => console.log("error"));
    }
    fetchData();
  }, []);
  return (
    <contextData.Provider value={[data, setData]}>
      {props.children}
    </contextData.Provider>
  );
};
